        public static int FindLength(int[] A, int[] B)
        {
            int max = 0;
            int[,] subArrays = new int[A.Length + 1, B.Length + 1];

            for (int i = 0; i < A.Length; i++)
            {
                for (int j = 0; j < B.Length; j++)
                {
                    if (B[j] == A[i])
                    {
                        subArrays[i + 1, j + 1] = subArrays[i, j] + 1;
                        max = Math.Max(subArrays[i + 1, j + 1], max);
                    }
                }
            }

            return max;
        }
